export const adminDashboardSlice = createSlice({
  name: "admin",
  initialState,
  reducers: {
    swipLeft: (state, action) => {
      state.toggleMenu = action.payload;
    },
    RejectionReson: (state, action) => {
      state.rejectionReason = [...state.rejectionReason, action.payload];

    },
    RejectionResonDel: (state, action) => {
      state.rejectionReason = state.rejectionReason.filter(
        (item) => item !== action.payload
      );
    },
  },
});
